import styled from 'styled-components';

const Card = () => {
  return (
    <div>
      <h1>euy</h1>
    </div>
  );
};

const CardWrapper = styled.div`
  width: 100%;
  text-align: center;
  text-transform: uppercase;
  border-bottom: 1px solid #ddd;
  cursor: pointer;

  &:hover {
    border-bottom: 1px solid black;
  }
`;

export default Card;
